{
  "schemaVersion" : "0.3",
  "assumeRole" : "{{AutomationAssumeRole}}",
  "parameters" : {
    "RouteTableId" : {
      "type" : "String",
      "description" : "(Required) The route table ID.",
      "allowedPattern" : "^(rtb-)([0-9a-f]){1,}$"
    },
    "AutomationAssumeRole" : {
      "default" : "",
      "type" : "String",
      "description" : "(Optional) The ARN of the role that allows Automation to perform the actions on your behalf."
    }
  },
  "mainSteps" : [ {
    "name" : "DeleteRoute",
    "action" : "aws:invokeLambdaFunction",
    "maxAttempts" : 1,
    "onFailure" : "Abort",
    "inputs" : {
      "FunctionName" : "DeleteRouteTableEntry",
      "Payload" : "{\"RouteTableId\": \"{{RouteTableId}}\"}\n"
    }
  } ]
}
